import {Container, Nav, Navbar} from "react-bootstrap";
import {Link} from "react-router-dom";

const Landing = () =>{
    return(
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Link to='/' style={{textDecoration: 'none'}}>
                        <Navbar.Brand>Vaccine Hunter</Navbar.Brand>
                    </Link>
                    <Nav className="me-auto">
                        <Link to='/' style={{textDecoration: 'none'}}><Nav.Link>Home</Nav.Link></Link>
                        <Link to='/' style={{textDecoration: 'none'}}><Nav.Link>Features</Nav.Link></Link>
                        <Link to='/' style={{textDecoration: 'none'}}><Nav.Link>Pricing</Nav.Link></Link>
                    </Nav>
                </Container>
            </Navbar>
        </>
    )
};

export default Landing;
